      <h1 className="text-center">Admin Panel</h1>
      <div className="row">
        <div className="col-md-3"></div>
        <div className="col-md-3"></div>
        <div className="col-md-3"></div>
        <div className="col-md-3"></div>
      </div>
    </div>
  );
};

export default Home;
